import React from 'react'
import Button from '../UI/Button'
import './Header.css'

export default function Header() {
  const fun = () => {
    alert("hello")
  }
  return (
    <>
      <div>
        <h1>Restaurent page</h1>
        <Button onClick={fun}>Your cart</Button>
      </div>

    </>
  )
}
